wwv_flow_imp_page.create_page_process(
 p_id=>wwv_flow_imp.id(116995982746022614208)
,p_process_sequence=>10
,p_process_point=>'ON_SUBMIT_BEFORE_COMPUTATION'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'SEARCH_PROCESS'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_count NUMBER;',
'BEGIN',
'    IF :P2_TABLE_NAME IS NULL THEN',
'        raise_application_error(-20001,''Please select a table first.'');',
'    END IF;',
'',
'    :P2_SHOW_PATIENTS := 0;',
'    :P2_SHOW_APPOINTMENTS := 0;',
'    :P2_SHOW_DEPARTMENTS := 0;',
'    :P2_SHOW_DOCTORS := 0;',
'    :P2_SHOW_SPECIALIZATIONS := 0;',
'    :P2_SHOW_DIAGNOSES := 0;',
'    :P2_SHOW_MEDICINES := 0;',
'    :P2_SHOW_PRESCRIPTIONS := 0;',
'    :P2_SHOW_TREATMENTS := 0;',
'    :P2_SHOW_BILLS := 0;',
'    :P2_SHOW_PAYMENTS := 0;',
'',
'',
'    IF :P2_TABLE_NAME = ''PATIENTS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM PATIENTS',
'        WHERE (:P2_PATIENT_ID IS NULL OR patient_id = :P2_PATIENT_ID)',
'          AND (:P2_PATIENT_FIRST_NAME IS NULL OR first_name = :P2_PATIENT_FIRST_NAME)',
'          AND (:P2_PATIENT_LAST_NAME IS NULL OR last_name = :P2_PATIENT_LAST_NAME)',
'          AND (:P2_PATIENT_PHONE IS NULL OR phone = :P2_PATIENT_PHONE)',
'          AND (:P2_PATIENT_EMERGENCY_CONTACT IS NULL OR emergency_contact = :P2_PATIENT_EMERGENCY_CONTACT)',
'          AND (:P2_PATIENT_EMAIL IS NULL OR email = :P2_PATIENT_EMAIL)',
'          AND (:P2_PATIENT_ADDRESS IS NULL OR address = :P2_PATIENT_ADDRESS)',
'          AND (:P2_PATIENT_GENDER IS NULL OR gender = :P2_PATIENT_GENDER)',
'          AND (:P2_PATIENT_BIRTH_DATE IS NULL OR birth_date = :P2_PATIENT_BIRTH_DATE)',
'          AND (:P2_PATIENT_HEIGHT IS NULL OR height = :P2_PATIENT_HEIGHT)',
'          AND (:P2_PATIENT_WEIGHT IS NULL OR weight = :P2_PATIENT_WEIGHT);',
'',
'        IF v_count > 1 THEN :P2_SHOW_PATIENTS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT first_name, last_name, phone, emergency_contact,',
'                   email, address, gender, birth_date, height, weight',
'            INTO :P2_PATIENT_FIRST_NAME, :P2_PATIENT_LAST_NAME,',
'                 :P2_PATIENT_PHONE, :P2_PATIENT_EMERGENCY_CONTACT,',
'                 :P2_PATIENT_EMAIL, :P2_PATIENT_ADDRESS,',
'                 :P2_PATIENT_GENDER, :P2_PATIENT_BIRTH_DATE,',
'                 :P2_PATIENT_HEIGHT, :P2_PATIENT_WEIGHT',
'            FROM PATIENTS',
'            WHERE patient_id = :P2_PATIENT_ID;',
'        ELSE raise_application_error(-20010,''No matching patients.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''APPOINTMENTS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM APPOINTMENTS',
'        WHERE (:P2_APPOINTMENT_ID IS NULL OR appointment_id = :P2_APPOINTMENT_ID)',
'          AND (:P2_APPOINTMENT_DATE IS NULL OR appointment_date = :P2_APPOINTMENT_DATE)',
'          AND (:P2_APPOINTMENT_TIME IS NULL OR appointment_time = :P2_APPOINTMENT_TIME)',
'          AND (:P2_APPOINTMENT_DOCTOR_ID IS NULL OR doctor_id = :P2_APPOINTMENT_DOCTOR_ID)',
'          AND (:P2_APPOINTMENT_DEPARTMENT_ID IS NULL OR department_id = :P2_APPOINTMENT_DEPARTMENT_ID)',
'          AND (:P2_APPOINTMENT_PATIENT_ID IS NULL OR patient_id = :P2_APPOINTMENT_PATIENT_ID);',
'',
'        IF v_count > 1 THEN :P2_SHOW_APPOINTMENTS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT appointment_date, appointment_time, doctor_id,',
'                   department_id, patient_id',
'            INTO :P2_APPOINTMENT_DATE, :P2_APPOINTMENT_TIME,',
'                 :P2_APPOINTMENT_DOCTOR_ID, :P2_APPOINTMENT_DEPARTMENT_ID,',
'                 :P2_APPOINTMENT_PATIENT_ID',
'            FROM APPOINTMENTS',
'            WHERE appointment_id = :P2_APPOINTMENT_ID;',
'        ELSE raise_application_error(-20010,''No matching appointments.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''DEPARTMENTS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM DEPARTMENTS',
'        WHERE (:P2_DEPARTMENT_ID IS NULL OR department_id = :P2_DEPARTMENT_ID)',
'          AND (:P2_DEPARTMENT_NAME IS NULL OR department_name = :P2_DEPARTMENT_NAME);',
'',
'        IF v_count > 1 THEN :P2_SHOW_DEPARTMENTS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT department_name',
'            INTO :P2_DEPARTMENT_NAME',
'            FROM DEPARTMENTS',
'            WHERE department_id = :P2_DEPARTMENT_ID;',
'        ELSE raise_application_error(-20010,''No departments found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''DOCTORS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM DOCTORS',
'        WHERE (:P2_DOCTOR_ID IS NULL OR doctor_id = :P2_DOCTOR_ID)',
'          AND (:P2_DOCTOR_FIRST_NAME IS NULL OR first_name = :P2_DOCTOR_FIRST_NAME)',
'          AND (:P2_DOCTOR_LAST_NAME IS NULL OR last_name = :P2_DOCTOR_LAST_NAME)',
'          AND (:P2_DOCTOR_EMAIL IS NULL OR email = :P2_DOCTOR_EMAIL)',
'          AND (:P2_DOCTOR_DEPARTMENT_ID IS NULL OR department_id = :P2_DOCTOR_DEPARTMENT_ID)',
'          AND (:P2_DOCTOR_SPECIALIZATION_ID IS NULL OR specialization_id = :P2_DOCTOR_SPECIALIZATION_ID);',
'',
'        IF v_count > 1 THEN :P2_SHOW_DOCTORS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT first_name, last_name, email, department_id, specialization_id',
'            INTO :P2_DOCTOR_FIRST_NAME, :P2_DOCTOR_LAST_NAME,',
'                 :P2_DOCTOR_EMAIL, :P2_DOCTOR_DEPARTMENT_ID,',
'                 :P2_DOCTOR_SPECIALIZATION_ID',
'            FROM DOCTORS',
'            WHERE doctor_id = :P2_DOCTOR_ID;',
'        ELSE raise_application_error(-20010,''No doctors found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''SPECIALIZATIONS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM SPECIALIZATIONS',
'        WHERE (:P2_SPECIALIZATION_ID IS NULL OR specialization_id = :P2_SPECIALIZATION_ID)',
'          AND (:P2_SPECIALIZATION_NAME IS NULL OR specialization_name = :P2_SPECIALIZATION_NAME);',
'',
'        IF v_count > 1 THEN :P2_SHOW_SPECIALIZATIONS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT specialization_name',
'            INTO :P2_SPECIALIZATION_NAME',
'            FROM SPECIALIZATIONS',
'            WHERE specialization_id = :P2_SPECIALIZATION_ID;',
'        ELSE raise_application_error(-20010,''No specializations found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''DIAGNOSES'' THEN',
'        SELECT COUNT(*) INTO v_count FROM DIAGNOSES',
'        WHERE (:P2_DIAGNOSIS_ID IS NULL OR diagnosis_id = :P2_DIAGNOSIS_ID)',
'          AND (:P2_DIAGNOSIS_APPOINTMENT_ID IS NULL OR appointment_id = :P2_DIAGNOSIS_APPOINTMENT_ID)',
'          AND (:P2_DIAGNOSIS_NAME IS NULL OR diagnosis_name = :P2_DIAGNOSIS_NAME);',
'',
'        IF v_count > 1 THEN :P2_SHOW_DIAGNOSES := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT appointment_id, diagnosis_name',
'            INTO :P2_DIAGNOSIS_APPOINTMENT_ID, :P2_DIAGNOSIS_NAME',
'            FROM DIAGNOSES',
'            WHERE diagnosis_id = :P2_DIAGNOSIS_ID;',
'        ELSE raise_application_error(-20010,''No diagnoses found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''MEDICINES'' THEN',
'        SELECT COUNT(*) INTO v_count FROM MEDICINES',
'        WHERE (:P2_MEDICINE_ID IS NULL OR medicine_id = :P2_MEDICINE_ID)',
'          AND (:P2_MEDICINE_NAME IS NULL OR medicine_name = :P2_MEDICINE_NAME)',
'          AND (:P2_MEDICINE_STOCK_QUANTITY IS NULL OR stock_quantity = :P2_MEDICINE_STOCK_QUANTITY)',
'          AND (:P2_MEDICINE_PRICE IS NULL OR price = :P2_MEDICINE_PRICE);',
'',
'        IF v_count > 1 THEN :P2_SHOW_MEDICINES := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT medicine_name, stock_quantity, price',
'            INTO :P2_MEDICINE_NAME, :P2_MEDICINE_STOCK_QUANTITY, :P2_MEDICINE_PRICE',
'            FROM MEDICINES',
'            WHERE medicine_id = :P2_MEDICINE_ID;',
'        ELSE raise_application_error(-20010,''No medicines found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''PRESCRIPTIONS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM PRESCRIPTIONS',
'        WHERE (:P2_PRESCRIPTION_ID IS NULL OR prescription_id = :P2_PRESCRIPTION_ID)',
'          AND (:P2_PRESCRIPTION_APPOINTMENT_ID IS NULL OR appointment_id = :P2_PRESCRIPTION_APPOINTMENT_ID)',
'          AND (:P2_PRESCRIPTION_MEDICINE_ID IS NULL OR medicine_id = :P2_PRESCRIPTION_MEDICINE_ID)',
'          AND (:P2_PRESCRIPTION_DURATION IS NULL OR duration = :P2_PRESCRIPTION_DURATION)',
'          AND (:P2_PRESCRIPTION_DOSAGE IS NULL OR dosage = :P2_PRESCRIPTION_DOSAGE);',
'',
'        IF v_count > 1 THEN :P2_SHOW_PRESCRIPTIONS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT appointment_id, medicine_id, duration, dosage',
'            INTO :P2_PRESCRIPTION_APPOINTMENT_ID,',
'                 :P2_PRESCRIPTION_MEDICINE_ID,',
'                 :P2_PRESCRIPTION_DURATION,',
'                 :P2_PRESCRIPTION_DOSAGE',
'            FROM PRESCRIPTIONS',
'            WHERE prescription_id = :P2_PRESCRIPTION_ID;',
'        ELSE raise_application_error(-20010,''No prescriptions found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''TREATMENTS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM TREATMENTS',
'        WHERE (:P2_TREATMENT_ID IS NULL OR treatment_id = :P2_TREATMENT_ID)',
'          AND (:P2_TREATMENT_TYPE IS NULL OR treatment_type = :P2_TREATMENT_TYPE)',
'          AND (:P2_TREATMENT_APPOINTMENT_ID IS NULL OR appointment_id = :P2_TREATMENT_APPOINTMENT_ID)',
'          AND (:P2_TREATMENT_DIAGNOSIS_ID IS NULL OR diagnosis_id = :P2_TREATMENT_DIAGNOSIS_ID)',
'          AND (:P2_TREATMENT_COST IS NULL OR treatment_cost = :P2_TREATMENT_COST);',
'',
'        IF v_count > 1 THEN :P2_SHOW_TREATMENTS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT treatment_type, appointment_id, diagnosis_id, treatment_cost',
'            INTO :P2_TREATMENT_TYPE, :P2_TREATMENT_APPOINTMENT_ID,',
'                 :P2_TREATMENT_DIAGNOSIS_ID, :P2_TREATMENT_COST',
'            FROM TREATMENTS',
'            WHERE treatment_id = :P2_TREATMENT_ID;',
'        ELSE raise_application_error(-20010,''No treatments found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''BILLS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM BILLS',
'        WHERE (:P2_BILL_ID IS NULL OR bill_id = :P2_BILL_ID)',
'          AND (:P2_BILL_APPOINTMENT_ID IS NULL OR appointment_id = :P2_BILL_APPOINTMENT_ID)',
'          AND (:P2_BILL_BILLING_DATE IS NULL OR billing_date = :P2_BILL_BILLING_DATE)',
'          AND (:P2_BILL_AMOUNT IS NULL OR amount = :P2_BILL_AMOUNT)',
'          AND (:P2_BILL_STATUS IS NULL OR status = :P2_BILL_STATUS);',
'',
'        IF v_count > 1 THEN :P2_SHOW_BILLS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT appointment_id, billing_date, amount, status',
'            INTO :P2_BILL_APPOINTMENT_ID,',
'                 :P2_BILL_BILLING_DATE,',
'                 :P2_BILL_AMOUNT,',
'                 :P2_BILL_STATUS',
'            FROM BILLS',
'            WHERE bill_id = :P2_BILL_ID;',
'        ELSE raise_application_error(-20010,''No bills found.'');',
'        END IF;',
'    END IF;',
'',
'',
'    IF :P2_TABLE_NAME = ''PAYMENTS'' THEN',
'        SELECT COUNT(*) INTO v_count FROM PAYMENTS',
'        WHERE (:P2_PAYMENT_ID IS NULL OR payment_id = :P2_PAYMENT_ID)',
'          AND (:P2_PAYMENT_BILL_ID IS NULL OR bill_id = :P2_PAYMENT_BILL_ID)',
'          AND (:P2_PAYMENT_DATE IS NULL OR payment_date = :P2_PAYMENT_DATE)',
'          AND (:P2_PAYMENT_AMOUNT IS NULL OR amount = :P2_PAYMENT_AMOUNT);',
'',
'        IF v_count > 1 THEN :P2_SHOW_PAYMENTS := 1; RETURN; END IF;',
'        IF v_count = 1 THEN',
'            SELECT bill_id, payment_date, amount',
'            INTO :P2_PAYMENT_BILL_ID,',
'                 :P2_PAYMENT_DATE,',
'                 :P2_PAYMENT_AMOUNT',
'            FROM PAYMENTS',
'            WHERE payment_id = :P2_PAYMENT_ID;',
'        ELSE raise_application_error(-20010,''No payments found.'');',
'        END IF;',
'    END IF;',
'',
'END;',
''))
