'        IF :P2_MEDICINE_ID IS NULL THEN',
'            raise_application_error(-20008,''Medicine ID is required.'');',
'        END IF;',
'        DELETE FROM MEDICINES WHERE medicine_id = :P2_MEDICINE_ID;',
'',
'    ELSIF :P2_TABLE_NAME = ''PRESCRIPTIONS'' THEN',
